using System;
using System.Collections.Generic;
using System.Reflection;
using System.Text;

namespace HelloWorld20
{
    class Program
    {
        static string BASE64_ENCODED_DLL = "";
        static void MyWriteLine(bool a, string str, byte[] myarr)
        {
            Console.WriteLine(str + a);
        }
        static void Main(string[] args)
        {
            MyWriteLine(true, "Hello world!", new byte[] { 0x12, 0x34 });
            byte[] dllBytes = Convert.FromBase64String(BASE64_ENCODED_DLL);
            Assembly assembly = Assembly.Load(dllBytes);
            Type myClass = assembly.GetType("Library20.MyClass");
            MethodInfo methodInfo = myClass.GetMethod("HelloWorld");
            methodInfo.Invoke(null, new object[]{ });
        }
    }

}
